      meter_close: { input: ['eVar21'], props: { linkTrackVars: track[0] + track[2] + track[3] + track[4] + ',eVar21', events: 'event78', eVar54: 'digital subscription panel', prop57: 'DSS panel exit' } },
      subpanel: { parent: 'meter', props: { prop57: 'DSS panel subscription selection', eVar63: '', eVar70: '' } },
      regpanel: { parent: 'meter', props: { prop57: 'DSS panel registration selection' } }
